import { Card, CardContent, Grid, Typography } from '@mui/material'
import React, { useEffect, useState } from 'react'
import { getMovieCommentDB } from '../../axios/detail/contentsLogic';
import Slider from 'react-slick';

const MovieDetailBtmSection = ({ movieDetail }) => {
  const movieId = movieDetail.movieId;
  const movieSeq = movieDetail.movieSeq;
  const [movieCommentList , setMovieCommentList] = useState([])
  const [carouselPosition, setCarouselPosition] = useState(0);

  useEffect(() => {
  const getMovieComment = async () => {
    try {
     const res = await getMovieCommentDB(movieId , movieSeq)
     setMovieCommentList(res)
    } catch (error) {
      console.log("영화 코멘트 로드 실패 : " , error);
    }
  }
  getMovieComment()
  },[])

  const handleCarouselPrev = () => {
    setCarouselPosition(carouselPosition - 1);
  };

  const handleCarouselNext = () => {
    setCarouselPosition(carouselPosition + 1);
  };

  const commentGroupWidth = 1600; // Adjust this value according to your design
  const commentGroupCount = Math.ceil(movieCommentList.length / 4);
  const maxCarouselPosition = -(commentGroupWidth * (commentGroupCount - 1));


  {/* Style */}


  const btmSectionStyle = {
    marginLeft: '100px',
    marginTop: '30px',
    maxWidth: '1500px',
    minHeight: '750px',
    maxHeight: '1600px',
  } 

  const commentListStyle = {
    width :'1200px',
    height : '500px',
    maxWidth:'1500px',
    maxHeight:'750px',
    marginTop : '30px'
  }

  const commentStyle ={
    width:'400px',
    height:'450px',
    marginRight : '50px',
    position: 'relative',
    
  }

  const commentGroupStyle = {
    display: 'flex',
    transition: 'transform 0.5s ease-in-out',
    transform: `translateX(${Math.min(0, Math.max(maxCarouselPosition, carouselPosition * commentGroupWidth))}px)`,
  };

   
  return (
    <>
 <div>
      <Typography variant="h4" style={{ fontSize: '25px' }}>
        코멘트
      </Typography>

      <div style={{ overflow: 'hidden', width: '1200px', height: '500px', marginTop: '30px' }}>
        <div style={commentGroupStyle}>
          {movieCommentList.map((movieComment, index) => (
            <div key={index} style={{ width: '300px', marginRight: '20px' }}>
              <Card sx={{ maxWidth: 350, minHeight: 300, border: 'none', backgroundColor: '#f5f5f5' }}>
                <CardContent>
                  {/* 프로필 이미지와 사용자 이름 */}
                  <div style={{ display: 'flex', alignItems: 'center', marginBottom: '10px' }}>
                    <div style={{ width: 35, height: 35, borderRadius: '50%', overflow: 'hidden', marginRight: '10px' }}>
                      <img src={movieComment.userProfileImage ? movieComment.userProfileImage : 'images/astronaut.jpg'} alt="프로필" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
                    </div>
                    <Typography variant="subtitle2" sx={{ fontSize: 15 }}>
                      {movieComment.userName}
                    </Typography>
                  </div>
                  <div style={{ width: '320px', borderBottom: '1px solid black', opacity: '10%', marginTop: '10px', marginBottom: '10px' }} />
                  <Typography variant="caption" style={{ fontSize: '15px' }}>
                    {movieComment.commentDetail}
                  </Typography>
                </CardContent>
              </Card>
            </div>
          ))}
        </div>
      </div>

      <button onClick={handleCarouselPrev} disabled={carouselPosition === 0}>Previous</button>
      <button onClick={handleCarouselNext} disabled={carouselPosition === maxCarouselPosition}>Next</button>
    </div>




    </>
  )
}

export default MovieDetailBtmSection
